import React from "react";
import "./style.css";

function Header() {
    return (
        <header class="header">

        <h1> Starcraft 2: Zerg Memory Game!  </h1>
        <h2> Click on an image to earn points, but don't click on any image more than once!     </h2>

        </header>
    )
}




export default Header;
